Text:
@Mondo: Respekt som tusan för dina grymma uploads. vet inte hur man skickar PM här men jag laddar ner en släkting till älvorna och ligger på 95.4% sedan en längre tid och torrenten verkar ha dött (skriver här bara för att jag antar att du inte kollar kommentarer på årsgamla torrenter).
Seedar du mig till 100% så gör jag detsamma med de som är kvar! 
Det är bara en allt för fet rulle för att försvinna i intigheten!!!! Tack som satan..
